def getColorDist(frame):
	fshape = frame.shape
	binshape = 5
	color_border = 255/binshape+1
	
	#cb = np.zeros(shape=(binshape**3))
	cb = np.zeros(shape=(binshape, binshape, binshape))
	frame = np.reshape(frame, (fshape[0]*fshape[1], 3))
	frame = np.divide(frame, color_border)

	for p in frame:
		#cb[binshape*binshape*p[0] + binshape*p[1] + p[2]] += 1
		cb[p[0]][p[1]][p[2]] += 1

	cb = np.reshape(cb, -1)
	return cb

def getBin(binshape, color_border, pixel, dr, dg, db):
	r = pixel[0]/color_border + dr
	g = pixel[1]/color_border + dg
	b = pixel[2]/color_border + db
	# if(r >= binshape or r <= 0 or g >= binshape or g <= 0 or b >= binshape or b <= 0):
	# 	return -1
	# else:
	return 	binshape*binshape*r + binshape*g + b

