def getColorScore(frame1, frame2): 
	cb1 = getColorBin(frame1)
	cb2 = getColorBin(frame2)

	diff = 0

	for i in range(len(cb1)):
		for j in range(len(cb2[0])):
			diff += abs(cb1[i][j] - cb2[i][j])
	return diff

def getColorBin(frame):
	fshape = frame.shape
	x_border = (fshape[0]/3)+1
	y_border = (fshape[1]/3)+1
	color_border = 255/3+1
	
	cb = np.zeros(shape=(9,27))
	for i in range(fshape[0]):
		for j in range(fshape[1]):
			bin_index = i/x_border+3*(j/y_border)
			pixel = frame[i][j]
			cb_index = 9*(pixel[0]/color_border) + 3*(pixel[1]/color_border) + pixel[2]/color_border
			#print(i,j,bin_index, cb_index, x_border, y_border)
			cb[bin_index][cb_index] += 1
	return cb


def getMPD(sqd, dof):
	dof = cv2.cvtColor(dof,cv2.COLOR_BGR2GRAY)
	sqd = cv2.cvtColor(sqd,cv2.COLOR_BGR2GRAY)

	shape = dof.shape

	dof = np.reshape(dof, (1,-1)) 
	sqd = np.reshape(sqd, (1,-1)) 

	diff = [s[0] if s[0] - s[1]*10 > 0 else 0 for s in zip(sqd[0], dof[0])]

	ssd = np.sum(diff)

	diff = np.reshape(diff, shape)

	return diff, ssd


def getMPDiff(frame1, frame2):
	#find the dense optical flow
	#find the ssd
	#subtract the grey motion information from the ssd for each pixel
	#sum the 
	dof = framesDenseOF(frame1, frame2)
	sqd = getSQD(frame1, frame2)

	return getMPD(sqd, dof)

def getCutScore(ssd1, ssd2, sqd3, dof3):
	diff3, ssd3 = getMPD(sqd3, dof3)

	score = ssd2*2 - ssd1 - ssd3

	return diff3, ssd3, score

def updateTop(toplist, count, diff2):
	tl_size = len(toplist)
	for i in range(tl_size):
		if(toplist[i][1] < diff2):
			toplist.insert(i, [count, diff2])
			break
	if(tl_size == len(toplist)):
		toplist.append([count,diff2])

def getSQD(img1, img2):
	dif = img1-img2

	sqdiff = dif**2

	return sqdiff


def balance(lists):
	def getKey(item):
		return item[0]
	def getKey1(item):
		return -item[1]

	balanced_list = []
	
	toplist	= sorted([[i[0],0] for i in lists[0]],key=getKey)

	max_value = 1e4
	for i in range(len(lists)):		
		list_min = lists[i][len(lists[i])-1][1] #min([y for x,y in lists[i]])
		balanced_list[:] = [[x,y - list_min] for x,y in lists[i]]
		ratio = max_value/balanced_list[0][1]
		balanced_list[:] = [[x[0], x[1]*ratio] for x in lists[i]]

		balanced_list[:] = sorted(balanced_list, key=getKey)
		for j in range(len(toplist)):
			toplist[j][1] += balanced_list[j][1]

	#print(toplist)

	return toplist


