def getFrame(cap, curr, index, skip):
	i = curr
	while(i < index):
		if(skip and i==index - 2):
			ret, frame1 = cap.read()
		elif(not skip and i==index - 1):
			ret, frame1 = cap.read()
		else:
			cap.grab()
		i+=1
	ret, frame2 = cap.read()
	if(skip):
		cap.grab()
		i+=1
	ret, frame3 = cap.read()
	i+=1

	return i, frame1, frame2, frame3


























